script: |
  super -f text -I q1669.spq | sort > q1669.out

inputs:
  - name: q1669.spq
    data: |
      SELECT DISTINCT ( ( cor0.col0 ) ) AS col1 FROM tab2 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet), tab0 (FORMAT parquet) AS cor1, tab2 (FORMAT parquet) AS cor2;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q1669.out
    data: |
      7
      78
      79
